INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES 
(1346, 'zhTW', '鐵鱗焚化者', '|cFFFFD200遊戲商城|r|n', '某個瘋狂的地精發明家幻想能騎上飛龍，於是他打造出這頭機械怪物。他利用被束縛的惡魔作為動力來源，以營造「真實巨龍之魂」的感覺。很遺憾，這位發明家在啟動它的時候不幸喪生了。', 34963),
(1346, 'zhCN', '汽鳞焚化者', '|cFFFFD200游戏商城|r|n', '某个疯狂的侏儒发明家梦见自己骑上了一头巨龙，就创造出了这头金属怪兽。他还用一只被困的恶魔来为其供能，其目的是为了创造出“正宗的巨龙之魂”。但他没能活过这头坐骑的第一次启动。', 34963),
(1346, 'ruRU', 'Паровой испепелитель', '|cFFFFD200Внутриигровой магазин|r|n', 'Один безумный гном всю жизнь мечтал полетать на драконе, и потому смастерил это металлическое чудище. В качестве источника энергии он использовал заточенного демона – как говорил он сам, для \"симуляции настоящей драконьей души\". Увы, пробный запуск изобретатель не пережил.', 34963),
(1346, 'ptBR', 'Incinerador Coração Demoníaco', '|cFFFFD200Loja do jogo|r|n', 'Um gnomo inventor maluco sonhava em montar em um dragão, então criou essa monstruosidade de metal, que energizou com um demônio aprisionado para criar \"uma alma autêntica de dragão\". O gnomo não sobreviveu à ativação.', 34963),
(1346, 'koKR', '증기비늘 소각룡', '|cFFFFD200게임 내 상점|r|n', '한 미치광이 노움 발명가가 용을 타고 달리는 꿈을 오래도록 품고 있었습니다. 결국 이런 금속 괴물을 만들어 내고야 말았죠. 더구나 \"진짜 용의 영혼\"을 만들기 위해 악마를 한 마리 잡아 연료로 사용했지만 기계가 작동하는 순간 목숨을 잃고 말았다고 합니다. ', 34963),
(1346, 'itIT', 'Inceneritore Scagliaferrea', '|cFFFFD200Negozio di gioco|r', 'Un folle inventore Gnomo sognava di cavalcare un drago, così ha creato questa mostruosità di metallo. L''ha alimentata con un demone intrappolato per ricreare \"un''autentica anima di drago\", ma non è sopravvissuto all''attivazione.', 34963),
(1346, 'frFR', 'Incinérateur fumécaille', '|cFFFFD200Boutique en jeu|r|n', 'Un Gnome, inventeur fou, rêva un jour qu’il chevauchait un dragon. Il créa donc ce monstre de métal. Il emprisonna un démon pour alimenter sa machine, afin de créer « l’âme authentique d’un dragon », mais ne survécut pas à son activation.', 34963),
(1346, 'esMX', 'Incinerador metalescama', '|cFFFFD200Tienda del juego|r|n', 'Un inventor gnomo loco tenía el sueño de montar un dragón y construyó esta monstruosidad de metal. Para crear \"una auténtica alma de dragón\", le dio energía con un demonio atrapado, pero no sobrevivió a la activación.', 34963),
(1346, 'esES', 'Incinerador escamavapor', '|cFFFFD200Tienda del juego|r|n', 'Un inventor gnomo loco soñaba con montar en un dragón, así que creó este monstruo de metal. Usó un demonio atrapado para darle energía y poder crear un \"alma de dragón auténtica\", pero no sobrevivió a su activación.', 34963),
(1346, 'deDE', 'Dampfschuppeneinäscherer', '|cFFFFD200WoW-Shop|r|n', 'Ein wahnsinniger gnomischer Erfinder hatte den Traum, einen Drachen zu reiten, und erschuf daher kurzerhand diese metallische Monstrosität. Als Antrieb verwendete er einen gefangenen Dämon, um \"eine authentische Drachsenseele\" zu erschaffen, jedoch überlebte er die Inbetriebnahme nicht.', 34963);
